import { Routes } from "@angular/router";

import { MainLayoutComponent } from "./layouts";

export const routes: Routes = [
  {
    path: '',
    component: MainLayoutComponent,
    loadComponent: () => import('./pages/home/home.component').then((c) => c.HomeComponent),
